import React from 'react';
import Header from "../header/Header";
import { Link } from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
import { Card, Button } from "react-bootstrap";
import data from "./data";

export default function A() {

   useEffect(() => {
    // Dynamically import images
    const paths = data.map(item => import(`./../Images/${item.imagePath}`).then(module => module.default));
    Promise.all(paths)
      .then(images => setImagePaths(images))
      .catch(error => console.error('Error loading images:', error));
  }, []);

  return (
    <div style={{ backgroundColor: "black" }}>
      <Header />
      <LinkContainer to="/kali">
        <div>
          <img src={require("../Images/kali.jpg")} alt='kali mata' height={150} width={150} />
          <figcaption> Kali </figcaption>
        </div>
      </LinkContainer>
      <div>
        {data?.map((item, index) => (
          <Card key={index} style={{ width: '16rem' }}>
            <Card.Img variant="top" src={require(item.abc)} />
            <Card.Body>
              <Card.Title>{item.title}</Card.Title>
              <Card.Text>
                {item.author}
              </Card.Text>
            </Card.Body>
          </Card>
        ))}
      </div>
    </div>
  );
}
